import { ScrollView } from "react-native";
import TodoItem from "./TodoItem";
import React from "react";

const TodoList = ({ todos, onRemove }) => {
  return (
    <ScrollView>
      todos.map(todo => (
      <TodoItem {...todo} />
      ));
    </ScrollView>
  );
};

export default TodoList;
